import React, {Component} from 'react';
import { Link } from 'react-router-dom';
import '../../index.css';

class Cadastro extends Component{
    constructor(props){
      super(props);
    }

    render(){
      return(
        <div>
            <h1>Cadastro</h1>
            <Link to="/"><button>Principal</button></Link>
        </div>
      )
    }
}

export default Cadastro;
